import React, { useState } from 'react';
import styles from './AdminPanel.module.css';

const endpoints = [
  {
    category: "Authentication",
    methods: [
      { name: "Login", type: "POST", url: "/api/Authentication/login" },
      { name: "Register", type: "POST", url: "/api/Authentication/Register" },
      { name: "Logout", type: "POST", url: "/api/Authentication/Logout" },
    ],
  },
  {
    category: "Categories",
    methods: [
      { name: "Get All Categories", type: "GET", url: "/api/Categories" },
      { name: "Create Category", type: "POST", url: "/api/Categories" },
      { name: "Get Category by ID", type: "GET", url: "/api/Categories/{categoryId}" },
      { name: "Update Category by ID", type: "PUT", url: "/api/Categories/{categoryId}" },
      { name: "Delete Category by ID", type: "DELETE", url: "/api/Categories/{categoryId}" },
    ],
  },
  {
    category: "Movies",
    methods: [
      { name: "Get All Movies", type: "GET", url: "/api/Movies" },
      { name: "Create Movie", type: "POST", url: "/api/Movies" },
      { name: "Get Movie by ID", type: "GET", url: "/api/Movies/{movieId}" },
      { name: "Update Movie by ID", type: "PUT", url: "/api/Movies/{movieId}" },
      { name: "Delete Movie by ID", type: "DELETE", url: "/api/Movies/{movieId}" },
    ],
  },
  {
    category: "Series",
    methods: [
      { name: "Get All Series", type: "GET", url: "/api/Series" },
      { name: "Create Series", type: "POST", url: "/api/Series" },
      { name: "Get Series by ID", type: "GET", url: "/api/Series/{seriesId}" },
      { name: "Update Series by ID", type: "PUT", url: "/api/Series/{seriesId}" },
      { name: "Delete Series by ID", type: "DELETE", url: "/api/Series/{seriesId}" },
    ],
  },
  {
    category: "Users",
    methods: [
      { name: "Get All Users", type: "GET", url: "/api/Users" },
      { name: "Create User", type: "POST", url: "/api/Users" },
      { name: "Get User by ID", type: "GET", url: "/api/Users/{userId}" },
      { name: "Update User by ID", type: "PUT", url: "/api/Users/{userId}" },
      { name: "Delete User by ID", type: "DELETE", url: "/api/Users/{userId}" },
    ],
  },
  {
    category: "Favorites",
    methods: [
      { name: "Get All Favorites", type: "GET", url: "/api/Favorites" },
      { name: "Create Favorite", type: "POST", url: "/api/Favorites" },
      { name: "Get Favorite by ID", type: "GET", url: "/api/Favorites/{favoriteId}" },
      { name: "Update Favorite by ID", type: "PUT", url: "/api/Favorites/{favoriteId}" },
      { name: "Delete Favorite by ID", type: "DELETE", url: "/api/Favorites/{favoriteId}" },
    ],
  },
  {
    category: "MoviesCategories",
    methods: [
      { name: "Add Movie-Category", type: "POST", url: "/api/MoviesCategories" },
      { name: "Get All Movie-Category Links", type: "GET", url: "/api/MoviesCategories" },
      { name: "Get Categories for Movie", type: "GET", url: "/api/MoviesCategories/movie/{movieId}" },
      { name: "Get Movies for Category", type: "GET", url: "/api/MoviesCategories/category/{categoryId}" },
    ],
  },
  {
    category: "SeriesCategories",
    methods: [
      { name: "Add Series-Category", type: "POST", url: "/api/SeriesCategories" },
      { name: "Get All Series-Category Links", type: "GET", url: "/api/SeriesCategories" },
      { name: "Get Categories for Series", type: "GET", url: "/api/SeriesCategories/series/{seriesId}" },
      { name: "Get Series for Category", type: "GET", url: "/api/SeriesCategories/category/{categoryId}" },
    ],
  },
];

const AdminPanel: React.FC = () => {
  const [response, setResponse] = useState<string | null>(null);
  const [loading, setLoading] = useState(false);

  const handleRequest = async (method: string, url: string) => {
    setLoading(true);
    setResponse(null);

    try {
      const formattedUrl = url
        .replace("{categoryId}", "1")
        .replace("{movieId}", "1")
        .replace("{seriesId}", "1")
        .replace("{favoriteId}", "1")
        .replace("{userId}", "1");

      const options: RequestInit = {
        method,
        headers: {
          "Content-Type": "application/json",
        },
      };

      if (method === "POST" || method === "PUT") {
        options.body = JSON.stringify({ key: "value" }); // POST ve PUT iÃ§in body
      }

      const res = await fetch(`http://localhost:5114${formattedUrl}`, options);

      if (!res.ok) {
        throw new Error(`Hata: ${res.status} - ${res.statusText}`);
      }

      const data = await res.json();
      setResponse(JSON.stringify(data, null, 2));
    } catch (error: any) {
      setResponse(`Error: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className={styles.adminContainer}>
      <h1 className={styles.title}>Admin Panel</h1>
      {endpoints.map((group) => (
        <div key={group.category} className={styles.endpointGroup}>
          <h2 className={styles.groupTitle}>{group.category}</h2>
          <div className={styles.buttonsContainer}>
            {group.methods.map((method) => (
              <button
                key={method.name}
                onClick={() => handleRequest(method.type, method.url)}
                className={styles.endpointButton}
              >
                {method.type}: {method.name}
              </button>
            ))}
          </div>
        </div>
      ))}
      <div className={styles.responseContainer}>
        <h2>Response:</h2>
        {loading ? <p>Loading...</p> : <pre>{response}</pre>}
      </div>
    </div>
  );
};

export default AdminPanel;
